('DOK2023/01/16/0001', '', 54, 'FORMULIR AUDIT GIZI', '2023-01-16', '', '2023-01-16', 23, '197008082009022001', 'Kulkas penyimpanan bahan makanan basah tampak kotor\r\nTempat pencusian masih tampak kotor disudut sudut ruangan ', 'Bersihkan kulkas dengan rutin\r\nBersihkan ruangan sampai sudut 2', 'Koordinasi dengan CS\r\nKoordinasi dengan IPCLS unit gizi\r\nMelakukan monitoring', '2023-01-16 06:38:33', '2023-01-16 06:38:33'),
('DOK2023/01/16/0002', '', 97, 'FORMULIR SUPERVISI PERAWATAN ALAT PASIEN DI CSSD', '2023-01-16', '', '2023-01-16', 12, '197008082009022001', 'Ruangan steril penyimpanan alat tidak sesuai dengan standar, masih di bawah tekanan positif 10', 'Buat tekanan positif sesuai standar', 'melakukan koordinasi dengan kesling dan IPSRS dalam hal perbaikan tekanan ruangan steril dengan berbagai upaya\r\n1. dengan peningkatan suhu lebih kuat\r\n2. mempersempit ruangan dengan pemasangan sekat', '2023-01-16 06:45:23', '2023-01-16 06:45:23'),
('DOK2023/01/16/0003', '', 99, 'AUDIT PENGELOLAAN LIMBAH', '2023-01-16', '', '2023-01-16', 18, '197008082009022001', 'savety bok sudah tersedia, akan tetapi masih blm standar, karena ada kemungkinan jarum dan cairan masih bisa keluar dan rembes lewat pojok pojoknya', 'sediakan tempat sampah benda tajam yang sesuai standar', 'Koordinasi dengan bagian Farmasi\r\nKoordinasi dengan kesling', '2023-01-16 06:51:19', '2023-01-16 06:51:19'),
